#!/usr/bin/perl
use strict;
use warnings;
use JSON::SL;
use Data::Dumper::Concise;
my $sl = JSON::SL->new();
my $txt = join("", <DATA>);

$sl->set_jsonpointer(["/rows/^"]);
my @Chunks = unpack("(a16)*", $txt);
foreach my $chunk (@Chunks) {
    my $res = $sl->feed($chunk);
    if ($res) {
        print "Got a chunk of data:\n";
        print Dumper($res);
    } else {
        print "Got no data yet..\n";
    }
}

